    public static Object buildObj(Class clazz)throws Exception{
        Object obj = clazz.getConstructor().newInstance();
        Field[] fields = clazz.getDeclaredFields();
        for(Field f : fields){
            f.setAccessible(true);
            Class<?> tp = f.getType();
            if(tp == int.class || tp == Integer.class){
                f.setInt(obj, 1);
            }else if(tp == double.class || tp == Double.class){
                f.setDouble(obj, 0.0);
            }else if(tp == String.class){
                f.set(obj, "");
            }else if(tp == boolean.class || tp == Boolean.class){
                f.setBoolean(obj, false);
            }else if(List.class.isAssignableFrom(tp)){
                List l = ArrayList.class.getConstructor().newInstance();
                l.add(buildObj(tp.getTypeParameters()[0].getClass()));
                f.set(obj, l);
            }else {
                f.set(obj, buildObj(tp));
            }
        }
        return obj;
    }
